import Avatar from '../Avatar/avatar.component'
import Link from '../Link/link.component'

function Header(){
  return(
    <header>
      <Avatar />
      <Link url="/" texto="Agende uma ligação" corTexto="#CCD6F6" />
    </header>
  )
}

export default Header
